/**
 * Collection of base64 encoded icons.
 * @readonly
 * @enum String
 * @todo Namespace this, so a Package can deliver its own icons.
 * @todo Traverse the registered icon packs for objects so we can even namespace the icons.
 */
vDesk.Visual.Icons = {

    vDesk:          "data:image/png;base64,",
    Default:        "data:image/png;base64,",
    Unknown:        "data:image/png;base64,",
    help:           "use:Unknown",
    about:          "data:image/png;base64,",
    administration: "data:image/png;base64,",
    settings:       "data:image/png;base64,",
    Logout:         "data:image/png;base64,",
    Favicon:        "data:image/png;base64,",
    Edit:           "data:image/png;base64,",
    Cancel:         "data:image/png;base64,",
    Copy:           "data:image/png;base64,",
    Cut:            "data:image/png;base64,",
    Paste:          "data:image/png;base64,",
    Delete:         "data:image/png;base64,",
    Save:           "data:image/png;base64,",
    View:           "data:image/png;base64,",
    Minimize:       "data:image/png;base64,",
    Maximize:       "data:image/png;base64,",
    Restore:        "data:image/png;base64,",
    Close:          "data:image/png;base64,",
    SelectAll:      "data:image/png;base64,",
    Refresh:        "data:image/png;base64,",
    TriangleRight:  "data:image/png;base64,",
};

vDesk.Load.Icons = {
    Status:   "Compiling icons",
    Compiled: false,
    Load() {
        if(!this.Compiled) {
            for(const {Namespace, Icon} of this.IterateIcons(vDesk.Visual.Icons)) {
                //Check if the icon uses another icon
                if(!Namespace[Icon].startsWith("use:")) {
                    //Create blob from imagedata and append it to the local resource collection.
                    Namespace[Icon] = this.Compile(Namespace[Icon]);
                }
            }
            for(const {Namespace, Icon} of this.IterateIcons(vDesk.Visual.Icons)) {
                //Check if the icon uses another icon
                if(Namespace[Icon].startsWith("use:")) {
                    //Assign the compiled icon to the key.
                    Namespace[Icon] = Namespace[Namespace[Icon].replace("use:", "")];
                }
            }
            this.Compiled = true;
        }
    },

    /**
     * Recursively iterates over the icons of a specified namespace.
     * @param {Object} Namespace The namespace within to search for the icons to iterate over.
     * @return {Generator<Object,String>} A Geenerator that yields every child namespace and icon of the specified parent namespace.
     */
    IterateIcons: function* (Namespace) {
        Ensure.Parameter(Namespace, Type.Object, "Namespace");
        for(const Icon in Namespace) {
            if(typeof Namespace[Icon] === Type.Object) {
                yield* this.IterateIcons(Namespace[Icon]);
            } else {
                yield {Namespace, Icon};
            }
        }
    },

    /**
     * Compiles the base64 representation of an icon into a binary resource identified by an ObjectUrl
     * @param {String} Icon The the base64 encoded representation of the icon to compile.
     * @return {String} An object url representing the specified icon.
     */
    Compile(Icon) {
        //Extract MimeType.
        const MimeType = Icon.substring(Icon.indexOf(":") + 1, Icon.indexOf(";"));

        const Chunks = [];

        //Extract base64 encoded data.
        const Data = atob(Icon.substring(Icon.indexOf(",") + 1, Icon.length));

        //Loop through decoded base64 data and convert each 512 chars into their ascii-value.
        for(let Offset = 0; Offset < Data.length; Offset += 512) {

            //Slice a chunk of 512 bytes.
            const Chunk = Data.slice(Offset, Offset + 512);

            //Convert the chars of the chunk into their ascii-value.
            const Charcodes = new Array(Chunk.length);
            for(let Index = 0; Index < Chunk.length; Index++) {
                Charcodes[Index] = Chunk.charCodeAt(Index);
            }
            Chunks.push(new Uint8Array(Charcodes));

        }
        return URL.createObjectURL(new Blob(Chunks, {type: MimeType}));
    },

    Free() {
        for(const Icon in vDesk.Visual.Icons) {
            URL.revokeObjectURL(vDesk.Visual.Icons[Icon]);
        }
    }
};